import React from 'react';
import FailedStamp from '../assets/FAILEDStamp.png';

function FailGame() {
  return (
    <div className="flex flex-col items-center gap-4">
      <img src={FailedStamp} alt="Failed" className="w-64 h-auto" />
      <button className="px-4 py-2 bg-red-600 text-white rounded-lg shadow">
        Return
      </button>
    </div>
  );
}

export default FailGame;
